import React from "react";
import Speak from "./Speak";

const Speakers = (props) => {
  return (
    <>
      {props.speakers.map((speakers, idx) => (
        <Speak key={idx} speakers={speakers} />
      ))}
    </>
  );
};

export default Speakers;
